import Header from '../components/Header';
import { Grid } from '@mui/material';
import Button from "../components/button";
import Footer from '../components/Footer';

const Form = () => {
    return (
        <div><Header />
        <div style={{ display: 'flex', justifyContent: 'space-between', margin: '0 auto', maxWidth: '1400px', marginTop: 80, marginBottom: 0 }}>
            <Header />

        {/* 左側の広告 */}
        <div style={{ width: '20%', backgroundColor: '#f0f0f0' }}>
          広告スペース
        </div>
        {/* ブログポストのコンテンツ */}
        <div style={{ flex: '1', padding: '0 20px', fontFamily: 'Noto Sans', fontSize: '18px', lineHeight: '2' }}>
          <h1>ブログポストのタイトル</h1>
          <p>みなさんは東京都豊島区にかつてあった「トキワ荘」という小さなアパートのことを知っているでしょうか。大都会東京の小さなアパートのことなど知るはずがない。そうおっしゃる方もいるでしょう。
ですがこの「トキワ荘」。実は日本のマンガの歴史を語るにあたって忘れることのできない原点ともいえる場所なのです。
          </p>

        {/* 画像 */}
        <img src="https://user0514.cdnw.net/shared/img/thumb/PP_tobitatuhikouki_TP_V.jpg" alt="ブログの画像" style={{ width: '800px', height: '500px', objectFit: 'cover' }} />
        {/* 画像の説明 */}
        <p>画像の説明をここに追加</p>
        </div>

        {/* 右側の広告 */}
        <div style={{ width: '20%', backgroundColor: '#f0f0f0' }}>
          広告スペース
        </div>

      </div>
      <Footer />
      </div>
    )
} 
export default Form;
